#include <leetcode.h>

double findMaxAverage(int* nums, int numsSize, int k)
{
	int i, j, l, sum, maxsum;
	double avg, max;

	max = (double)-10000.0;
	while (k <= numsSize) {
		for (i = 0, sum = 0; i < k; i++)
			sum += nums[i];
		maxsum = sum;
		for (j = 0; i < numsSize; i++, j++) {
			sum = sum + nums[i] - nums[j];
			if (sum > maxsum)
				maxsum = sum;
		}
		avg = (double)maxsum/(double)k;
		if (avg > max)
			max = avg;
		k++;
	}
	return max;
}

